import HTTP from '@/config/axiosApi'

const SrvSeries = {
    getTvSeries(payload){
        return HTTP.get('/tv/popular',payload).then(respuesta => {
            return respuesta
        }).catch(error => {
            console.error(error)
            return error
        })
    }
}

export default SrvSeries;
